import axios from "axios";

const url = "https://api.github.com/users";

const Fetch = async (username) => {
  console.log(username);
  const changableurl = `${url}/${username}`;
  try {
    const {
      data: { bio },
    } = await axios.get(changableurl);
    return { bio };
  } catch (error) {
    console.log(error);
  }
};

export default Fetch;
